	function getMousePosition(e){
		var offsetX = e.pageX - this.offsetLeft,
			offsetY = e.pageY - this.offsetTop,
			p = this,
			newEvent = {};
			
		while(p = p.offsetParent){
			offsetX -= p.offsetLeft;
			offsetY -= p.offsetTop;
		}
		return {
			x : offsetX,
			y : offsetY,
			pageX : e.pageX,
			pageY : e.pageY
		}
	}
	
