GooJS.Util.HSV2RGB = function(h, s, v){
	
	var r, g, b;

	if(h.constructor == Array ){
		s = h[1];
		v = h[2];
		h = h[0];
	}
	if(s == 0){
		r = g = b = v;
	}
	else{
		var i = Math.floor(h/60);
	}
	var f = h/60-i,
		p = v*(1-s),
		q = v*(1-s*f),
		t = v*(1-s*(1-f));

	switch(i){
		case 0:
			r = v;
			g = t;
			b = p;
			break;
		case 1:
			r = q;
			g = v;
			b = p;
			break;
		case 2:
			r = p;
			g = v;
			b = t;
			break;
		case 3:
			r = p;
			g = q;
			b = v;
			break;
		case 4:
			r = t;
			g = p;
			b = v;
			break;
		case 5:
			r = v;
			g = p;
			b = q;
			break;
	}

	return "rgb("+ parseInt(r*255)+"," + parseInt(g*255)+","+parseInt(b*255)+")";
}

